    // fetchDeposits
    //
    //     {
    //         "id": 5167969,
    //         "asset": "BIDR",
    //         "network": "BSC",
    //         "address": "0x101a925704f6ff13295ab8dd7a60988d116aaedf",
    //         "addressTag": "",
    //         "txId": "113409337867",
    //         "amount": "15000",
    //         "transferType": 1,
    //         "status": 1,
    //         "insertTime": "1659429390000"
    //     }
    //
    // fetchWithdrawals
    //
    //     {
    //         "id": 4245859,
    //         "clientId": "198",
    //         "asset": "BIDR",
    //         "network": "BSC",
    //         "address": "0xff1c75149cc492e7d5566145b859fcafc900b6e9",
    //         "addressTag": "",
    //         "amount": "10000",
    //         "fee": "0",
    //         "txId": "113501794501",
    //         "transferType": 1,
    //         "status": 10,
    //         "createTime": 1659521314413
    //     }
    //
    // withdraw
    //
    //     {
    //         "code": 0,
    //         "msg": "",
    //         "data": {
    //             "withdrawId":"12"
    //         },
    //         "timestamp": 1571745049095
    //     }
    //
